import React from "react";

class Valikot extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      maakunnat: [],
    };
  }

  render() {
    return <div>test</div>;
  }
}

componentDidMount: {
  //this.setState({ maakunnat: props.maakunnat });
  console.log("Valikoissa!");
  this.setState({ maakunnat: this.props.maakunnat });
  console.log(maakunnat);
}

export default Valikot;
